import React from 'react';
import './App.css';
import CreateTest from './components/CreateTest/CreateTest';
import TestResults from './components/TestResults/TestResults';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>WinAb</h1>
        <p>Discover what customers respond to with A/B testing</p>
      </header>
      <nav className="App-nav">
        <div className="tab">
          <CreateTest />
        </div>
        <div className="tab">
          <TestResults />
        </div>
      </nav>
    </div>
  );
}

export default App;
